DROP TABLE IF EXISTS `base_files`;
CREATE TABLE `base_files` (
  `id` varchar(32) NOT NULL COMMENT 'id',
  `file_name` varchar(200) NOT NULL COMMENT '附件名称',
  `type` smallint(4) DEFAULT '0' COMMENT '文件类型：0其他，1营业执照，2法人身份证正面，3法人身份证反面，4配载图，5双方签约的货运合同  6双方签约的补充协议   7货运合同  8补充协议  9平台签署的货运合同 10平台签署的补充协议  11订单其他文件  12货物离港封装照片 13配载舱位图  14海运运输单  15驳船运输单  16汽运运输单  17卸货交接清单 18货物到港封装照片 19订单货运合同 20集港通知 101损货附件 102处理附件，103账户头像 ,104登记表图片，105货损确认函，106货物运输长协协议 107转包合同',
  `file_url` varchar(500) DEFAULT NULL COMMENT '系统存储附件的地址',
  `file_size` int(12) DEFAULT NULL COMMENT '附件的大小，单位为KB，整数',
  `table_name` varchar(32) NOT NULL COMMENT '表名称\r\n            ',
  `record_id` varchar(32) NOT NULL COMMENT '表中的记录编号（数据ID）',
  `sign_status` tinyint(2) DEFAULT NULL COMMENT '如文件需签章 存放签 章状态  枚举值 1-待签 2-已签',
  `repeat_flag` varchar(30) DEFAULT NULL COMMENT '重复签章码 当第一次未成功 生成一随机码 再签 ',
  `creator` varchar(100) DEFAULT NULL COMMENT '创建人',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `changer` varchar(100) DEFAULT NULL COMMENT '修改人',
  `chang_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `effective` smallint(2) DEFAULT '1' COMMENT '设置是否有效（1表示有效，0表示无效），默认为1',
  `is_thumbnail` smallint(1) DEFAULT '0' COMMENT '是否是缩略图，0否，1是',
  `sign_time1` datetime DEFAULT NULL COMMENT '甲方签章时间',
  `sign_time2` datetime DEFAULT NULL COMMENT '乙方签章时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `index_record_id` (`record_id`) USING BTREE,
  KEY `index_table_name` (`table_name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='base_files-附件表';

