DROP TABLE IF EXISTS `quartz_info`;
CREATE TABLE `quartz_info` (
  `id` varchar(50) NOT NULL COMMENT '主键ID，UUID_32',
  `job_code` varchar(50) NOT NULL COMMENT '业务主键ID，UUID_32',
  `job_name` varchar(100) DEFAULT NULL COMMENT '任务名称',
  `remark` varchar(255) DEFAULT NULL COMMENT '任务说明',
  `run_state` int(11) DEFAULT NULL COMMENT '任务状态，0：其他，1：正在运行，2：成功结束，3：异常结束',
  `run_begin` timestamp NULL DEFAULT NULL COMMENT '任务执行的开始时间',
  `run_end` timestamp NULL DEFAULT NULL COMMENT '任务执行的结束时间',
  `prev_run_state` int(11) DEFAULT '0' COMMENT '上一次任务状态，0：其他，1：正在运行，2：成功结束，3：异常结束，默认值：0',
  `prev_run_begin` timestamp NULL DEFAULT NULL COMMENT '上一次任务执行的开始时间',
  `prev_run_end` timestamp NULL DEFAULT NULL COMMENT '上一次任务执行的结束时间',
  `app_begin` int(11) DEFAULT NULL COMMENT '业务数据开始时间（时间戳，秒）',
  `app_end` int(11) DEFAULT NULL COMMENT '业务数据结束时间（时间戳，秒）',
  `job_class` varchar(200) NOT NULL COMMENT '任务实现类全路径class名',
  `cron_time` varchar(50) NOT NULL COMMENT '任务触发时间，cron格式字符串，如：0 0 12 * * ?',
  `job_group_name` varchar(200) DEFAULT 'QUARTZ_JOBGROUP_NAME' COMMENT '任务组，默认值：QUARTZ_JOBGROUP_NAME',
  `trigger_group_name` varchar(200) DEFAULT 'QUARTZ_TRIGGERGROUP_NAME' COMMENT '触发器组，默认值：QUARTZ_TRIGGERGROUP_NAME',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间，默认值：CURRENT_TIMESTAMP',
  `upd_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间，默认值：CURRENT_TIMESTAMP',
  `create_user` varchar(50) DEFAULT NULL COMMENT '创建者',
  `upd_user` varchar(50) DEFAULT NULL COMMENT '修改者',
  `del_flg` int(11) DEFAULT '0' COMMENT '删除标识，1：已删除，0：未删除，默认值：0',
  `is_apply` int(11) DEFAULT '0' COMMENT '是否激活  0：休眠  1：激活   默认值：0',
  `system` varchar(20) DEFAULT NULL COMMENT '所属系统',
  PRIMARY KEY (`id`,`job_code`,`job_class`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='定时任务配置表';

